import React from 'react';
import Navbar from "./navbar";
import styled from 'styled-components';
import Mainlanding from "./mainlanding";

const GridContainer = styled.div`
    display: grid;
    height: 100vh;
    background-color: #EFE7E2;
`

function Home() {
    return (
        <GridContainer>
            <Navbar/>
            <Mainlanding/>
        </GridContainer>
    );
}

export default Home;
